function App() {
	return (
		// <div className="App">
		// 	<ShopPage />
		// </div>

		<BrowserRouter>
			<ScrollToTop />
			<Routes>

				<Route path="/" element={<HomeTwo />} />
				<Route path="/pass" element={<PassSection />} />
				<Route path="*" element={<ErrorPage />} />
			</Routes>
		</BrowserRouter>
	);
}

export default App;
